<script>
    const acces_dog_one = document.querySelector('.acces__dog--one'),
        acces_dog_two = document.querySelector('.acces__dog--two'),
        acces_dog_three = document.querySelector('.acces__dog--three'),
        acces_observer = new IntersectionObserver(entries => {
            setTimeout(() => {
                acces_dog_three.classList.toggle( 'dog__animation', entries[0].isIntersecting );
            }, "500");
            setTimeout(() => {
                acces_dog_two.classList.toggle( 'dog__animation', entries[0].isIntersecting );
            }, "1000");
            setTimeout(() => {
                acces_dog_one.classList.toggle( 'dog__animation', entries[0].isIntersecting );
            }, "1500");
        });
    acces_observer.observe( acces_dog_one, acces_dog_two, acces_dog_three );
    jQuery(function ($) {
        $('.acces__hours .acces__hours--row').eq(new Date().getDay()-1).addClass('today');
    });
</script>
